import {ProductConsumer} from "../Context";
import {Link} from "react-router-dom";

class Details extends Component{
    render() {
        return(
          <ProductConsumer>
              {(value) => {
                  const {productName, productCode, productPrice, img} = value.productDetails;
              }}
          </ProductConsumer>
        );
    }
}

export default Details;
